import React from "react";
import c1 from "src/images/c1.jpg";
import "./Foot.css"

function Footer() {
    return (
        <div className="footer">
            <div className="back">
                <img src={c1} alt="" width="58em" height="58em" srcset="" />
            </div>

        </div>

    );
}

export default Footer;
